from functools import partial

import numpy as np
import tensorflow as tf
from tensorflow.python.data import AUTOTUNE

from src.data import celeba_tff
from src.data.abstract_dataset import AbstractDataset


class CelebADataset(AbstractDataset):
    @property
    def class_labels(self):
        return ['female', 'male']

    @property
    def dataset_size(self):
        if self.dataset_cfg.use_val_data:
            return {'train': 177457, 'test': 11416, 'val': 11415}
        return {'train': 177457, 'test': 22831}

    @property
    def local_dataset_sizes(self):
        return np.mean(list(LOCAL_CELEBA_DATASET_SIZES.values())), np.std(list(LOCAL_CELEBA_DATASET_SIZES.values()))

    def get_default_accuracy(self):
        return 0.858    # todo

    def get_dataset_size_for_client(self, client_id):
        assert self.is_federated
        return LOCAL_CELEBA_DATASET_SIZES[client_id]

    def _load_tf_dataset(self):
        self._load_tff_dataset()
        self.train_ds = self.train_ds.create_tf_dataset_from_all_clients()

    def _load_tff_dataset(self, distribution='equal'):
        celeba_train, celeba_test = celeba_tff.load_data(split_by_clients=False)

        def element_fn(element):
            label = element['male']
            downscaled_img = tf.image.resize(element['image'],
                                             size=[self.dataset_cfg.data_dim, self.dataset_cfg.data_dim],
                                             method='bilinear', antialias=True)
            if self.normalisation_mean_zero:
                return downscaled_img / 127.5 - 1, label
            return downscaled_img / 255.0, label

        def preprocess_federated_dataset(dataset, cache=True):
            preprocessed_ds = dataset.map(element_fn, num_parallel_calls=AUTOTUNE)
            if cache:
                return preprocessed_ds.cache()
            return preprocessed_ds

        def preprocess_centralized_dataset(dataset, total_dataset_size, cache=True):
            preprocessed_ds = (dataset
                               .shuffle(buffer_size=total_dataset_size,
                                        reshuffle_each_iteration=False)
                               .map(element_fn, num_parallel_calls=AUTOTUNE))
            if cache:
                return preprocessed_ds.cache()
            return preprocessed_ds

        self.train_ds = celeba_train.preprocess(preprocess_federated_dataset)
        self.test_ds = preprocess_centralized_dataset(celeba_test.create_tf_dataset_from_all_clients(),
                                                      total_dataset_size=self.dataset_size['test'],
                                                      cache=(not self.dataset_cfg.use_val_data))
        if self.dataset_cfg.use_val_data:
            self.val_ds = self.test_ds.shard(num_shards=2, index=0).cache()
            self.test_ds = self.test_ds.shard(num_shards=2, index=1).cache()


